import React from 'react'
import { Col, Form, Row } from 'react-bootstrap'

function MessageForm() {
  function handleSubmit(e) {
    e.preventDefault();
  }
  
  return (
    <div className='messages-output'>
      <Form onSubmit={handleSubmit}>
<Row>
  <Col>
  </Col>
</Row>
      </Form>
    </div>
  )
}

export default MessageForm
